    "Health of mule and white-tailed deer at Rocky Mountain Arsenal : March-April 1991",nt"tracking_summary":
    {ntt"total": 0,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-30T12:25:03.163566",nt"name": "health-of-mule-and-white-tailed-deer-at-rocky-mountain-arsenal-march-april-1991",nt"isopen":
    false,nt"url": null,nt"notes": "Mule deer (Odocoileus hemionus) and white-tailed
    deer(~ virginianus), reside within the Arsenal. Little information about the health
    of these animals in relation to their environment has been available. This study
    was intended to document the health of Arsenal mule and white-tailed deer in order
    to provide a source of information on which to base wildlife management decisions
    and in order to describe their overall health at a point in time with which later
    data can be compared. Thirteen mule deer and 10 white-tailed deer were collected
    from the Arsenal between 18 March and 2 April, 1991. Thorough necropsies were conducted
    on each animal. Tissues were collected for histopathological analyses and selective
    follow-up laboratory analyses to evaluate health and to compare with behavioral
    observations.",nt"license_title": "License Not Specified",nt"extras":
